  about_text_our_mission_title: "VORES MISSION",
  about_text_our_mission_description:
    "Vores mission er at g\u00f8re tr\u00e6nere tilg\u00e6ngelige for alle ud\u00f8vere i verdenen.",
  about_text_title_what_we_do: "HVAD VI LAVER",
  about_text_description_what_we_do:
    "Coachsome er en formidlingsplatform, som skaber kontakten mellem tr\u00e6nere og ud\u00f8vere. Vi g\u00f8r det ekstremt nemt for tr\u00e6nere at starte deres forretning og hj\u00e6lpe dem med markedsf\u00f8ring. Det g\u00f8r vi fordi vi \u00f8nsker at skabe bedre ud\u00f8vere og give dem muligheden for at finde kvalitets tr\u00e6nere, der kan hj\u00e6lpe dem med at maksimere deres potentiale.",
  about_text_title_how_it_started: "S\u00c5DAN STARTEDE DET",
  about_text_description_how_it_started:
    "Efter en sommer hvor founder Peter havde tilbudt personlig basketball tr\u00e6ning, opdagede han den store eftersp\u00f8rgelse, der var p\u00e5 personlig tr\u00e6ning. Samtidigt opdagede han ogs\u00e5 den store udfordring, der ligger i at starte s\u00e5dan en forretning op fra bunden. Sammen med sin f\u00e6tter og co-founder Alexander, diskuterede de to ideen om en markedsplads for personlige tr\u00e6nere, som vil g\u00f8re det muligt at starte en tr\u00e6ningsforretning op p\u00e5 f\u00e5 minutter. Det eneste problem var bare, hvordan kunne de f\u00e5 denne ide til at blive til virkelighed? Peter brugte derfor sommeren i \u00e5r 2019 p\u00e5 at pr\u00e6sentere projektet for mulige partnere, og endte med at komme i kontakt med Kasper & Martin. De to investerende fonders kunne hj\u00e6lpe de to f\u00e6tre med at designe og udvikle platformen, og sammen grundlagde Peter, Alexander, Martin & Kasper Coachsome d.7 November, 2019.",
